import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const LeftMenu = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
`

function LeftSide() {
  return (
      <LeftMenu>
          <Link to={`/gallery`}>Gallery</Link>
      </LeftMenu>
  );
}

export default LeftSide;
